import React, { Component } from 'react';
import { FirebaseDatabaseProvider } from "@react-firebase/database";

const config = {
    apiKey: "AIzaSyBgrQbASbVXmvtw0FcvlG4rX9fMLMQncoM",
    authDomain: "wifi-coffee-machine.firebaseapp.com",
    databaseURL: "https://wifi-coffee-machine.firebaseio.com",
    projectId: "wifi-coffee-machine",
    appId: "194524524603",
}

export default class System extends Component {
    render() {
        return (
            <div style={styles}>
                <FirebaseDatabaseProvider firebase={firebase} {...config}>
                    <div>
                        <FirebaseDatabaseNode
                            path="user_bookmarks/"
                            limitToFirst={this.state.limit}
                            // orderByKey
                            orderByValue={"created_on"}
                        >
                            {d => {
                                return (
                                    <React.Fragment>
                                        <pre>Path {d.path}</pre>
                                        <pre style={{ height: 300, overflow: "auto" }}>
                                            Value {s(d.value)}
                                        </pre>
                                        <button
                                            onClick={() => {
                                                this.setState(state => ({ limit: state.limit + 2 }));
                                            }}
                                        >
                                            Load more
                    </button>
                                    </React.Fragment>
                                );
                            }}
                        </FirebaseDatabaseNode>
                    </div>
                </FirebaseDatabaseProvider>
            </div>
        );
    };
};
